import axios from 'axios';
import {useEffect} from 'react';
import { Scrollbars } from 'react-custom-scrollbars';

const renderThumb = ({ style, ...props }) => {
    const thumbStyle = {
        borderRadius: 6,
        backgroundColor: 'lightgray'
    };
    return <div style={{ ...style, ...thumbStyle }} {...props} />;
};
  
const CustomScrollbars = props => (
    <Scrollbars
        renderThumbHorizontal={renderThumb}
        renderThumbVertical={renderThumb}
        {...props}
    />
);
  

export default function TutorDashboard(props) {
    const {setDisplayNavbar, setUser} = props;
    setDisplayNavbar(true);
    useEffect(() => {
        const ac = new AbortController();
        axios.get('/auth/isLoggedIn')
            .then(res => res.data)
            .catch(err => console.log(err))
            .then(res => {
                if (res.isLoggedIn) {
                    const user = res.user;
                    setUser(user);
                } else {
                    window.open('/', '_self');
                }
            })
        return () => {
            ac.abort();
        }
    }, [setUser]);

    return <div className="wrapper">
        <div className="sidebar">

        </div>
        <div className="content" style={{overflowX: "hidden"}}>
            <div className="calendar_container">
                <CustomScrollbars autoHide autoHideTimeout={500} autoHideDuration={200}>
                <div className="calendar_header">
                    <ul className="weekdays">
                        <li>SUN</li>
                        <li>MON</li>
                        <li>TUE</li>
                        <li>WED</li>
                        <li>THU</li>
                        <li>FRI</li>
                        <li>SAT</li>
                    </ul>

                    <ul className="daynumbers">
                        <li>1</li>
                        <li>2</li>
                        <li>3</li>
                        <li>4</li>
                        <li>5</li>
                        <li>6</li>
                        <li>7</li>
                    </ul>
                </div>
                <div className="timeslots_container">
                    <ul className="timeslots">
                        <li>GMT+7</li>
                        <li>01:00</li>
                        <li>02:00</li>
                        <li>03:00</li>
                        <li>04:00</li>
                        <li>05:00</li>
                        <li>06:00</li>
                        <li>07:00</li>
                        <li>08:00</li>
                        <li>09:00</li>
                        <li>10:00</li>
                        <li>11:00</li>
                        <li>12:00</li>
                        <li>13:00</li>
                        <li>14:00</li>
                        <li>15:00</li>
                        <li>16:00</li>
                        <li>17:00</li>
                        <li>18:00</li>
                        <li>19:00</li>
                        <li>20:00</li>
                        <li>21:00</li>
                        <li>22:00</li>
                        <li>23:00</li>
                    </ul>
                </div>

                <div className="event_container">
                    <div className="slot slot-1">
                        <div className="event_status"></div>
                        <span>Event A</span>
                    </div>
                    <div className="slot slot-2">
                        <div className="event_status"></div>
                        <span>Event A</span>
                    </div>
                </div>
                </CustomScrollbars>
            </div>
        </div>
    </div>
}
